import React from 'react'

function Project() {
  return (
    <div classNameName='project section'>
 <Turn options={options} className="magazine">
      {pages.map((page, index) => (
        <div key={index} className="page">
          <img src={page} alt="" />
        </div>
      ))}
    </Turn>
    </div>
  )
}

export default Project
